MongoDB aggregation $match with $or<p>Is there a way to search a mongodb database using an array of objects as search arguments?</p>
<p>Lets say I have the following search preferences:</p>
<pre><code>preferences = [{
    product: &quot;PRODUCT_A&quot;,
    minqty: 5,
    maxqty: 50
  },
  {
    product: &quot;PRODUCT_B&quot;,
    minqty: 100,
    maxqty: 500
  }
]
</code></pre>
<p>In my database I have Jobs with the following structure:</p>
<pre><code>{
  jobName: &quot;job name&quot;,
  items: [{
      product: &quot;PRODUCT_A&quot;
      qty: 25
    },
    {
      product: &quot;PRODUCT_F&quot;
      qty: 300
    }

  ]
}
</code></pre>
<p>I would like to query the database using preferences and returning any jobs that match <strong>at least one of the criteria's</strong>.</p>
<h2>ATTEMPT 1:</h2>
<p>I managed to use all my preferences as filters, but <code>$match</code> is cumulative, the way it's written it works like <code>&amp;&amp;</code> in javascript. My goal is to have &quot;match THIS <code>||</code> match THAT&quot;.</p>
<pre><code>let pipeline = [];

preferences.map((item) =&gt; {
  let search = {
    product: item.product,
    quantity: { $gte: item.minqty, $lte: item.maxqty },
  };

  return pipeline.push({
    $match: {
      items: {
        $elemMatch: search,
      },
    },
  });
});

const jobs = await Job.aggregate(pipeline);
</code></pre>
<h2>ATTEMPS 2 (SUCCESS):</h2>
<pre><code>let search = [];

preferences.map((item, index) =&gt; {
  let arguments = {
    product: item.product,
    quantity: { $gte: item.minqty, $lte: item.maxqty },
  };

  search.push(arguments);
});

let pipeline = [
  {
    $match: {
      items: {
        $elemMatch: {
          $or: search,
        },
      },
    },
  },
];

const jobs = await Job.aggregate(pipeline);
</code></pre>

