&lt;p&gt;Sometimes making things less fun is for the best. Case in point: The Samsung Galaxy Buds Pro.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;Just a handful of months after Samsung graced us with the delightfully bean-shaped (and genuinely good) &lt;a href=\&quot;https://mashable.com/review/samsung-galaxy-buds-live-review/\&quot;&gt;Galaxy Buds Live&lt;/a&gt;, we've already got a more, uh, \&quot;professional\&quot; follow-up. At $199.99, the Galaxy Buds Pro are only marginally more expensive than the Buds Live, but offer a totally different look and a few extra features, largely revolving around active noise cancellation.&lt;/p&gt;
&lt;p&gt;The end result is something that should please Samsung fans (and Android users in general). But is there any reason to spend that extra $30 instead of getting the &lt;em&gt;already totally fine&lt;/em&gt; Galaxy Buds Live?&amp;nbsp;&lt;/p&gt;
&lt;div&gt;

&lt;div&gt;
&lt;div&gt;
&lt;div&gt;
&lt;p&gt;
Much more comfortable than Buds Live • Improved ANC • Sound quality is still great • Strong app-based customization
&lt;/p&gt;&lt;/div&gt;
&lt;div&gt;
&lt;p&gt;
Voice detection feature is a dud • ANC struggles with outdoor bustle
&lt;/p&gt;&lt;/div&gt;

&lt;/div&gt;



&lt;/div&gt;
&lt;/div&gt;

&lt;h2&gt;The Good: Improved ANC and comfort, SmartThings Find, sound quality&lt;/h2&gt;
&lt;p&gt;The most noticeable difference between the Buds Live and the Buds Pro from the jump is their appearance. As we've discussed, the Buds Live were shaped like something you'd find in a burrito and, on a practical level, let a decent amount of outside noise in due to the lack of a seal of any kind. Their ANC features did a little bit to offset this, but it wasn't good enough. It was pretty sweet that they attracted next to no earwax because they didn't actually go inside the ear, though.&lt;/p&gt;
&lt;p&gt;The Buds Pro aren't nearly as eye-catching but they make up for it in the ways that actually matter. Like &lt;a href=\&quot;https://mashable.com/review/airpods-pro-review/\&quot;&gt;Apple's AirPods Pro&lt;/a&gt; equivalent, the Buds Pro have rubber ear cups that you insert into the ear canal with a rounded touch panel that sits outside featuring basic playback controls. Tap once to pause, tap twice to skip ahead, and so on. Samsung is shipping the Buds Pro with three different ear cup sizes to accommodate different ear shapes, as well.&lt;/p&gt;
&lt;div&gt;
&lt;div&gt;

&lt;figure&gt;&lt;div&gt;
