&lt;/p&gt;&lt;/div&gt;


&lt;figcaption&gt;&lt;p&gt;Galaxy Buds Pro
&lt;/p&gt;&lt;/figcaption&gt;&lt;p&gt;Image:  alex perry / mashable
&lt;/p&gt;&lt;/figure&gt;
&lt;/div&gt;
&lt;/div&gt;
&lt;p&gt;From a purely physical standpoint, the Buds Pro are fundamentally a step up from the Buds Live because of how much better they feel in the ear. The \&quot;beans\&quot; fit snugly and were never a threat to fall out, but the insides of my ears didn't appreciate long sessions with them, and signaled that with minor aching. By virtue of keeping hard plastic away from the sensitive skin inside my ears, the Buds Pro were &lt;em&gt;significantly&lt;/em&gt; more comfortable for lengthy periods of time.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;The ear tips not only make the Buds Pro more comfortable, but they also do a much better job of blocking unwanted outside noise than the Buds Live's open form factor did. While the ANC here still isn't perfect (more on that in a bit), it's a real improvement. When it's enabled and you're not in close proximity to chaos, you'll be able to listen to your music or podcasts in peace.&lt;/p&gt;
&lt;p&gt;Just like the Buds Live, Samsung's newest earbuds can connect to the &lt;a href=\&quot;https://play.google.com/store/apps/details?id=com.samsung.android.app.watchmanager&amp;amp;hl=en_US&amp;amp;gl=US\&quot; target=\&quot;_blank\&quot;&gt;Galaxy Wearable&lt;/a&gt; Android app for all of your settings and customization needs. That app is Android-only, so iPhone owners should probably buy some AirPods instead. Within the Wearable app you can set ANC to high or low (I didn't notice a huge difference between the two), turn it off entirely, or turn on an ambient sound mode that uses the on-board microphones to amplify sounds around you in situations where you might need to hear what people are saying.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;Beyond that, you can adjust what the long-press command on the earbuds' outer panels does (taps are set in stone), choose from a handful of different equalizer options like \&quot;bass boost\&quot; and \&quot;treble boost,\&quot; or even shift the audio balance to favor the left or right side if your hearing is better in one ear than the other. This amount of customization was a strong aspect of the Buds Live and it's still strong here, as well. It isn't super different, but it's appreciated nonetheless.&lt;/p&gt;
&lt;p&gt;Another side of the Buds Pro that picks up where Buds Live left off is sound quality. I was really impressed with how deep and rich the sound was in the \&quot;beans\&quot; despite their unusual shape. That hasn't changed with the shift to a more traditional build. The audio output here isn't dramatically better than what I experienced in the \&quot;beans,\&quot; but the 11mm woofer and 6.5mm tweeter inside do an excellent job of making songs sound like they should.&amp;nbsp;&lt;/p&gt;
&lt;figure&gt;&lt;div&gt;
